import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail author="Paul" timeAgo="Today at 4:45PM" post="Hey There!"/>
            <CommentDetail author="John" timeAgo="Today ata 2:00AM" post="Just passing by"/>
            <CommentDetail author="Jenny" timeAgo="Today at 5: 00PM" post="Nice Blog"/>
            <CommentDetail author="Jessica" timeAgo="Today at 11:55PM"/>
            <CommentDetail author="Arthur" timeAgo="Today at 3:45PM" post="Hi!"/>
            <CommentDetail author="Aurora" timeAgo="Today at 9:15PM" post="How are you?"/>
            <CommentDetail author="Alpha" timeAgo="Today at 3:45PM" post="I like your blog"/>
        </div>
    );
};

ReactDOM.render(<App/>, document.querySelector('#root'));
